import { Form } from "@pdfme/ui";
import { generate } from "@pdfme/generator";

const domContainer = document.getElementById("container");
const template = {
  schemas: [
    {
      field1: {
        type: "text",
        position: {
          x: 74.65,
          y: 37.80,
        },
        width: 9,
        height: 7,
        alignment: "left",
        fontSize: 12,
        characterSpacing: 0,
        lineHeight: 1.15,
      },
      field2: {
        type: "text",
        position: {
          x: 23.81,
          y: 44.71,
        },
        width: 168.61,
        height: 30.73,
        alignment: "left",
        fontSize: 11,
        characterSpacing: 0,
        lineHeight: 1.4,
      },
    },
  ],
  basePdf:
    "data:application/pdf;base64,",
};
const inputs = [
  {
    field1: "42A",
    field2:
      "Eduardo C Ordoñez (MP 1-34179) por la participacion acordada en caracter de Actor en estos Autos caratulados: 'CASCON, GREGORIO HECTOR C/ CONSORCIO BALCONES DE SANTA FE - ABREVIADO - CONSIGNACION' Expte N 9295104, ratificando domicilio procesal oportunamente constituido en Calle 9 de Julio 843 - Barrio Alberdi, de esta Ciudad, comparece ante V.S. y respetuosamente dice:",
  },
];
const form = new Form({ domContainer, template, inputs });

document.querySelector("button").addEventListener("click", async () => {
  const inputs = form.getInputs();
  const pdf = await generate({ template, inputs });
  const blob = new Blob([pdf.buffer], { type: "application/pdf" });
  window.open(URL.createObjectURL(blob));
});
